import Container from "react-bootstrap/Container"
import CardStyle from "./Card"



export const CardList = ({ data, Datas, Loading, setCartArticle }) => (

	<Container className="d-flex flex-wrap mt-3"
		style={{ justifyContent: 'center', alignItems: 'center' }}
	>
		{Loading ? (
			<div>Loading...</div>
		) : (
			Datas.map(
				person => { 
					if(person.id==1){
						person.price=28
					}
					if(person.id==1){
						person.image = {data} 
					}

				return <CardStyle key={person.id} person={person} setCartArticle={setCartArticle} data={data}/> 
			}

			)
		)}
	</Container>
)
